import menuLogo from '../../images/menuLogo.png'
const Menu = () => {
    return (
        <div className="menuParent">
            <div className="logo">
                <img src={menuLogo} />
            </div>
            <div className="menuItems"></div>
            <div className="signOut"></div>
        </div>
    )
}
export default Menu;
